  //     // fetch the new product based and set it to the state of the component
  //  };
  // };

  render() {
    return (
      <div
        style={{ border: "1px solid green", color: "green", margin: "20px" }}
      >
        <h1>Find Component</h1>
        <Weather cityId={this.state.cityId} />
      </div>
    );
  }
}

export default Find;
